import { Link } from 'react-router-dom';
import { Header, Nav } from 'grommet';

function Navigation() {

  return (
    <Header background="brand" pad="medium">
      <Nav direction="row">
        <Link to='/list'>Exercise List</Link>
        <Link to='/workout'>Start Workout</Link>
      </Nav>
    </Header>      
  );
}

export default Navigation;
